import React from "react";
import ToDoForm from './toDoForm.js';

function ToDoList() {
    const [items, setItems] = useState([])

    function addToDo(item) {
        setItems([...items, {title: item, isCompleted: false}])
        console.log(item)
    }

    return(
        <div>
            <ToDoForm addToDo={addToDo}/>
        </div>
    )
}

export default ToDoList
